import React from 'react';
import { useAuth } from '../context/AuthContext';

const Dashboard = () => {
  const { user } = useAuth(); // Ensure user is correctly fetched

  return (
    <div>
      <h1>Dashboard</h1>
      {user ? (
        <p>Welcome, {user.coor_fname} {user.coor_lname}!</p>
      ) : (
        <p>Loading user data...</p>
      )}
    </div>
  );
};

export default Dashboard;
